/* imagezoom.js */
$(function() {
    (function imageZoom() {
      var options = {
        allowPanToNext: false,
        captionEl: false,
        closeOnScroll: false,
        counterEl: false,
        history: false,
        index: 0,
        pinchToClose: false,
        preloaderEl: false,
        shareEl: false,
        tapToToggleControls: false,
        getThumbBoundsFn: function(index) {
          var thumbnail = document.querySelectorAll(".slick-active .photoswipe__image")[0];
          var pageYScroll =
            window.pageYOffset || document.documentElement.scrollTop;
          var rect = thumbnail.getBoundingClientRect();
          return { x: rect.left, y: rect.top + pageYScroll, w: rect.width };
        }
      };
  
      // generate image data
      function getImageData() {
        var items = [];
  
        $(".slick-slide:not(.slick-cloned) .photoswipe__image").each(function() {
          var image = {
            msrc: $(this).prop("src"),
            src: $(this).prop("src"),
            w: $(this).data('photoswipe-width'),
            h: $(this).data('photoswipe-height'),
            initialZoomLevel: 0.65
          };
  
          items.push(image);
        });
  
        // remove duplicates
        //items.shift();
        //items = items.slice(0,items.length / 2);
  
        console.log("TCL: getImageData -> items", items);
        
        return items;
      }
  
      // initiate and open gallery on click
      $(".js-photoswipe__zoom").on("click", function() {
        var gallery = new PhotoSwipe(
          document.querySelectorAll(".pswp")[0],
          PhotoSwipeUI_Default,
          getImageData(),
          options
        );
        gallery.init();
      });
    })();
  });
  